import logo from "../../assets/img/logo.png";
import styled from "styled-components";

const Box = styled.div`
  width: 2px;

`;

const Image = styled.img`
width: 180px;
`

function Logo(params) {
  return (
    <Box>
      <Image src={logo} />
    </Box>
  );
}
export default Logo;
